// src/components/TestCalendar.js
import React from 'react';
import FullCalendar from '@fullcalendar/react';
import dayGridPlugin from '@fullcalendar/daygrid';
import timeGridPlugin from '@fullcalendar/timegrid';
import interactionPlugin from '@fullcalendar/interaction';

const TestCalendar = () => {
  return (
    <div style={{ padding: '20px', maxWidth: '800px', margin: 'auto', backgroundColor: '#f0f4f8' }}>
      <FullCalendar
        plugins={[dayGridPlugin, timeGridPlugin, interactionPlugin]}
        initialView="dayGridMonth"
        headerToolbar={{
          start: 'prev,next today',
          center: 'title',
          end: 'dayGridMonth,timeGridWeek',
        }}
        events={[
          { title: 'Event 1', date: '2024-09-10' },
          { title: 'Event 2', date: '2024-09-12' },
        ]}
        dateClick={(info) => alert(`Clicked on date: ${info.dateStr}`)}
      />
    </div>
  );
};

export default TestCalendar;
